import React from 'react';
import './CardsExam.css';
import CardItem from './CardItem';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCalendarDays } from '@fortawesome/free-solid-svg-icons'
import { faUsers } from '@fortawesome/free-solid-svg-icons'
import { faTimer } from '@fortawesome/free-solid-svg-icons'


function CardsExam() {
    return (
        <div className='exams-content'>
            <h2>Tên đề thi</h2>
            <p><FontAwesomeIcon icon={faCalendarDays} />
                20-25-2002</p>

            <p><FontAwesomeIcon icon={faUsers} />
                20 lượt thi</p>

                <p><FontAwesomeIcon icon="fa-regular fa-timer" />
                20 lượt thi</p>
                <i class="fa-regular fa-timer"></i>

                <hr class="fade"/>

                
               <button className='loading'></button>
              <button className='button-exams'>Bắt đầu thi</button>
        </div>
    );
}

export default CardsExam;
